    data: |
      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col2 * col0 BETWEEN + col2 + col1 AND ( + col0 + cor0.col0 );
  - name: tab0

outputs:
  - name: q1902.out
    data: |
      24	86	33
      35	97	1
      89	91	82
